import React from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUserPlus, faUserTimes, faMoneyBillWave, faMoneyCheckAlt, faWallet } from '@fortawesome/free-solid-svg-icons';

const NavbarContainer = styled.div`
  background-color: #004080;
  padding: 15px;
  color: white;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const NavLeft = styled.div`
  display: flex;
  justify-content: flex-start;
  gap: 20px;
`;

const NavRight = styled.div`
  display: flex;
  justify-content: flex-end;
  gap: 20px;
`;

const Logo = styled.h1`
  font-size: 24px;
  margin: 0 auto;
`;

const NavItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  cursor: pointer;

  &:hover {
    color: #a9c4eb;
  }
`;

const IconLabel = styled.span`
  margin-top: 5px;
  font-size: 12px;
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <NavLeft>
        <NavItem>
          <FontAwesomeIcon icon={faMoneyBillWave} size="2x" />
          <IconLabel>Deposit Money</IconLabel>
        </NavItem>
        <NavItem>
          <FontAwesomeIcon icon={faMoneyCheckAlt} size="2x" />
          <IconLabel>Withdraw Money</IconLabel>
        </NavItem>
        <NavItem>
          <FontAwesomeIcon icon={faWallet} size="2x" />
          <IconLabel>Check Balance</IconLabel>
        </NavItem>
      </NavLeft>

      <Logo>BankLogo</Logo>

      <NavRight>
        <NavItem>
          <FontAwesomeIcon icon={faUserPlus} size="2x" />
          <IconLabel>Create Account</IconLabel>
        </NavItem>
        <NavItem>
          <FontAwesomeIcon icon={faUserTimes} size="2x" />
          <IconLabel>Close Account</IconLabel>
        </NavItem>
      </NavRight>
    </NavbarContainer>
  );
};

export default Navbar;
